pleText":"Zulu"}}],"defaultAudioTrackIndex":0}},"videoDetails":{"videoId":"qW8YCvrCjrU","title":"Dr. Gundry Talks CORONAVIRUS And How To STAY HEALTHY! | Lewis Howes","lengthSeconds":"4978","keywords":["lewis howes","lewis howes interview","dr. gundry interview","dr. steven gundry","coronavirus","how to stay healthy","healthy foods","how to live longer","health interview","inspiration","motivation","inspirational video","motivational","motivational speech","wealth","school of greatness","health theory","success","success interview","how to boost your immune system","health advice","foods to eat","gut health","microbiome","coronavirus health advice","motivational videos","gundry md","the dr gundry podcast"],"channelId":"UCKsP3v2JeT2hWI_HzkxWiMA","isOwnerViewing":false,"shortDescription":"Dr. Steven Gundry is a renowned cardiologist, surgeon, medical device inventor, and bestselling author. Although he has performed thousands of heart surgeries in his 40-year career, Dr. Gundrys current focus is empowering people through diet to reverse and prevent ailments. Hes the Director and Founder of the International Heart \u0026 Lung Institute as well as the Center for Restorative Medicine in Palm Springs and Santa Barbara, CA. He helps patients learn how to take control of their weight, health, and energy by using his surprisingly simple diet advice.\n\nHes the New York Times best-selling author of The Plant Paradox, and his latest book is The Longevity Paradox which is all about how we can live long, healthy lives and fight the diseases of aging. He also hosts his own health podcast, The Dr. Gundry Podcast which gives you the tools and information you need to hack your vitality, avoid dangerous health foods, and balance your all-important gut.\n\nThis is the third time Ive had Dr. Gundry on The School of Greatness, and each time Im inspired by his knowledge and his motivation to help other people learn the truth about food, gut health, and mental clarity. Check out our past e
